import React, {useState, useEffect} from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [movies, setMovies] = useState({})

  const getMovies = () => {
    axios.get('https://api.themoviedb.org/3/movie/550?api_key=0cf6ed9c56b8823214f56d72674f0c60')
    .then(function (response) {
      // handle success
      setMovies(response.data)
      console.log(response);
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .then(function () {
      // always executed
    });
  }

  useEffect(() => {
    getMovies();
  }, [])


  return (
    <div className="App">
      <h1>Build Netflix Clone ðŸš€</h1>
      <img src={movies.poster_path} />
    </div>
  );
}

export default App;
